
<style>
    svg {
        height: 31rem;
    }
    @keyframes right-hand-spin{
        0%{
            transform : rotate(0deg);
        }
        100%{
                transform : rotate(45deg);
        }
    }
    @keyframes LP-right-hand-spin{
            0%{
            transform : rotate(0deg);
        }
        100%{
                transform : rotate(-5deg);
        }
    }
    @keyframes Dog-left-hand-spin{
        0%{
            transform : rotate(0deg);
        }
        100%{
                transform : rotate(30deg);
        }

    }
    @keyframes LP-left-spin{
        0%{
            transform : rotate(0deg);
        }
        100%{
                transform : rotate(22deg);
        }
    }
    .right-hand{
        animation: right-hand-spin 1s cubic-bezier(0.26,0.21,0,0.85) forwards alternate infinite; transform-origin: 73% 46%;
    }
    .LP-right-hand{
            animation: LP-right-hand-spin 1s cubic-bezier(0.26,0.21,0,0.85) forwards alternate infinite; transform-origin: 19% 42%;
    }
    .Dog-left-hand{
        animation: Dog-left-hand-spin 1s cubic-bezier(0.26,0.21,0.37,1.3) forwards alternate infinite; transform-origin: 94% 41%;
    }
    .LP-left {
            animation: LP-left-spin 1s cubic-bezier(0.26,0.21,0.37,1.3) forwards alternate infinite; transform-origin: 57% 32%;
    }
</style>
